import React from 'react'
import { SocialIcon } from 'react-social-icons';


function Home() {
  return (
    <div className="min-h-screen #4d7c0f grid place-items-center">
      

      <div className="flex ">
        <div className="flex-cols-3 p-5 gap-y-5">
         
              <SocialIcon className="m-5  h-50 w-50" url="https://twitter.com/jaketrent" bgColor="white" />
              <SocialIcon  className="m-5  h-50 w-50 fill-white" url="https://youtube.com/jaketrent" bgColor="white" />
              <SocialIcon className="m-5 h-50 w-50" url="https://LinkedIn.com/jaketrent" bgColor="white"  />
          
       
        
        </div>
      </div>
      
    
        
    </div>
  )
}

export default Home
